import React, { Component } from 'react'


export default class StepProposition extends React.Component {
    constructor(props) {
        super(props);

    }


    render() {

        const { rows, cols, selected } = this.props;

        if (selected) {
            const stepProposition = <div className='step-proposition-container'><textarea rows={rows} cols={cols} style={{ resize: 'none', overflow: 'hidden' }}></textarea>
                <div className="frequency-scale-container">
                    <form></form>
                </div>
            </div>
        }

        return stepProposition;


    }

}
